import LeagueSelection from "./SelectLeague";
import {NavLink, Outlet} from "react-router-dom"

export default function Home({
    inputUsername,
    handleUsernameChange,
    handleConfirmUser,
    username,
    leagues,
    handleLeagueChange,
    handleLeagueConfirm,
    confirmedLeague,
    handleShowRosters,
    handleLeagueButton,
    selectedLeague, 
    rosters,
    userData
}) {
    return (
      <div className="home">
        {username ? (
          <>
            <h2>Welcome, {username}</h2>
            {!confirmedLeague && (
              <LeagueSelection
                leagues={leagues}
                handleLeagueChange={handleLeagueChange}
                handleLeagueConfirm={handleLeagueConfirm}
              />
            )}
            {confirmedLeague && (
              <>
              <h2>Current League : {selectedLeague.name}</h2>
              <div class="RootLayout">
                <nav>
                <NavLink to="/trade-analzyer"></NavLink>
                <NavLink to="/show-rosters">ShowRosters</NavLink>
                <NavLink to="trade-analyzer">TradeAnalyzer</NavLink>
                {console.log(userData, "this is username part after navlink")}
                </nav>
                </div>
              </>
            )}
          </>
        ) : (
          <>
            <h2>Welcome</h2>
            <div className="input-group">
              <input
                type="text"
                value={inputUsername}
                onChange={handleUsernameChange}
                className="username-input"
                placeholder="username"
              />
              <button onClick={handleConfirmUser}>Confirm</button>
            </div>
            <main>
              <Outlet />
            </main>
          </>
        )}
      </div>
    );
}
